  true,\n\t\"url\": null,\n\t\"notes\": \"The Mission M&E MIS/ GIS will be a new,
  web-based MIS/GIS, customized to USAID/Jordan's reporting needs that will provide
  accurate, real time and useful performance monitoring information for USAID/Jordan
  and Implementing Partners. This new system will be developed as a part of the USAID/Jordan
  Monitoring and Evaluation Support Project (USAID MESP) (SOL-278-13-000018) Procurement
  which is currently in-process as of June 1, 2013. The design of the system will
  take into account and be compatible with other existing data collection systems
  already in place in Jordan (as researched by the Contractor, e.g. systems maintained
  by the government of Jordan, NGOs or other donors) and provide solutions that make
  use of that data to the extent possible to avoid duplication and an additional work
  burden. It will reduce data collection costs, save time and improve the accuracy
  of reporting, and provide a flexible and easy-to-use reporting capability enabling
  USAID/Jordan to respond to a wide variety of reporting requirements and ad-hoc requests.
  It will allow users to track activity-based information, such as baselines, targets,
  outputs and outcomes for the purpose of conducting performance-driven reviews.\",\n\t\"license_title\":
